import moment from "moment";

export class InfoBpmModel{    
    constructor(instanceId=0,transactId=0,processId=0,) {
      this.instanceId=instanceId;
      this.transactId=transactId;
      this.processId=processId;
      this.activityId=0;
      this.clientId=0;
      this.clientName="";
    }
  }
